import * as types from '../actions';

export default function(state = 'You have no knives!  Go buy some!', action) {

  const knifeReducer = action.knifeReducer;

  console.log(state);
  switch(action.type) {
    case types.ADD_KNIFE:
      return { ...state, knifeReducer };
    default:
      return state;
  }
};
